document.querySelector(".theme-button").addEventListener("click",(()=>{var t=document.querySelector("html");console.log("click");var e=document.querySelectorAll(".contact-items"),r=document.querySelectorAll(".social-images");if("dark"==t.getAttribute("data-bs-theme")){t.setAttribute("data-bs-theme","light"),document.getElementById("btnSwitch").textContent="Switch to Dark Theme";for(var l=0;l<e.length;l++)e[l].classList.add("border-dark"),e[l].classList.remove("border-white"),r[l].setAttribute("fill","#343a40")}else for(t.setAttribute("data-bs-theme","dark"),document.getElementById("btnSwitch").textContent="Switch to Light Theme",l=0;l<e.length;l++)e[l].classList.add("border-white"),e[l].classList.remove("border-dark"),r[l].setAttribute("fill","#fff")}));